import React from 'react';

export default function firebaseLogo() {
  return (
    <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
      <path d="M7.78 31.346 12.51.922A1.084 1.084 0 0 1 14.54.578L19.626 10.12 7.78 31.346zm33.59 7.382L36.866 10.73a1.086 1.086 0 0 0-1.836-.59l-28.4 28.588 15.714 8.856a3.24 3.24 0 0 0 3.174 0l15.852-8.856zM28.6 14.296l-3.64-6.964a1.084 1.084 0 0 0-1.92 0L7.06 35.968 28.6 14.296z" fill="url(#paint0_linear)"/>
      <defs>
      <linearGradient xmlns="http://www.w3.org/2000/svg" id="paint0_linear" x1="24" y1="0" x2="24" y2="48" gradientUnits="userSpaceOnUse">
        <stop stopColor="#7BCBD4"/>
        <stop offset="1" stopColor="#29C6B7"/>
      </linearGradient>
      </defs>
    </svg>
  )
}
